import firebase from '../Pojo/Firebase.js';
let db = firebase.firestore();

// Estructura de DB para Usuario
const company = {
    email       :   undefined,
    companyName :   undefined,
    tradeName   :   undefined,
    nit :   undefined,
    logo : undefined,
    addresses    :   {
        0   :  {
            address :   undefined,
            neighborhood    :   undefined,
            phone   :   undefined,
            mobile  :   undefined,
            email   :   undefined,
            notificationId  :   undefined,
            postalcode  :   undefined,
            country :   undefined,
            state   :   undefined,
            city    :   undefined,
            info    :   undefined
        },
        1   :  {
            address :   undefined,
            neighborhood    :   undefined,
            phone   :   undefined,
            mobile  :   undefined,
            email   :   undefined,
            notificationId  :   undefined,
            postalcode  :   undefined,
            country :   undefined,
            state   :   undefined,
            city    :   undefined,
            info    :   undefined
        }
    },
    banks   :   {
        0   :   {
            bankId    :   undefined,
            number      :   undefined,
            type        :   undefined,
            title       :   undefined
        }
    }
}


//se pasa un estado por defecto para definicion de estructura
function Geo(state = company, action){
    var NewState = Object.assign({},state);
    if(action.type == "Geo"){
        NewState = action.data;
        return NewState;
    }else return NewState;

}

const DaoGeo = {Geo}

export default DaoGeo;
